import jxl.*
import java.io.*
import com.eviware.soapui.support.XmlHolder


def file = new File("C:\\Users\\KanmaniMaravarman\\Desktop\\soapUi\\CustomerData.xls")

//want to fetch the woorkbook and sheet contain the data

def workbook = Workbook.getWorkbook(file)
def sh = workbook.getSheet(0)
def rows = sh.getRows();
log.info "Number of rows are  $rows"

for (def i=1;i<rows;i++)
{
	input = sh.getCell(0,i);
	email = input.getContents();
	log.info email
	testRunner.testCase.setPropertyValue("email",email)
	testRunner.runTestStepByName("Save")

	//get the response from the save
	def res = context.expand('${Save#response}')
	def response = new XmlHolder(res)
	def customerId = response.getNodeValue('//customerId')
	log.info customerId
	testRunner.testCase.setPropertyValue("customerId",customerId)
	testRunner.runTestStepByName("GetList")
	testRunner.runTestStepByName("GetById")
	testRunner.runTestStepByName("DeleteById")



}

import groovy.sql.Sql
import com.eviware.soapui.support.XmlHolder
import java.io.*

def url = 'jdbc:mysql://localhost:3306/customer'
def user= 'root'
def password = 'root'
def driver = 'com.mysql.jdbc.Driver'


com.eviware.soapui.support.GroovyUtils.registerJdbcDriver(driver)

def sql = Sql.newInstance(url,user,password,driver)

sql.eachRow('select * from mailid'){
	row ->
	def mailid = "$row.id";
	log.info mailid
	testRunner.testCase.setPropertyValue("mailid",mailid)
	testRunner.runTestStepByName("Save")

	//get the response from the save
	def res = context.expand('${Save#response}')
	def response = new XmlHolder(res)
	def AddressId = response.getNodeValue('//defaultBilling')
	log.info AddressId
	testRunner.testCase.setPropertyValue("AddressId",AddressId)
	def customerId = response.getNodeValue('//customerId')
	log.info customerId
	testRunner.testCase.setPropertyValue("customerId",customerId)
	testRunner.runTestStepByName("GetById")
	testRunner.runTestStepByName("DeleteById")
	testRunner.runTestStepByName("DeleteByUserId")

}
